(70, 'RFH00068', 'Activity Outsourcing to HEPL', 'Aishwaryaa B', '9894441172', 'aishwaryaa.b@hemas.in', 'SELF', 'Usha Guru', 'Capture1.PNG', 0, NULL, 'Software Developer', 'WFH', 'In and around Cuddalore and Pondy', 'HEPL', '5', '', 'IT', '2', 'PHP\r\nKnowledge of PHP web frameworks including Yii, Laravel, and CodeIgniter.\r\nKnowledge of front-end technologies including CSS3, JavaScript, and HTML5.\r\nUnderstanding of object-oriented PHP programming.\r\nPrevious experience creating scalable applications.\r\n\r\nASP.NET\r\nFamiliarity with the ASP.NET framework, SQL Server and design/architectural patterns (e.g. Model-View-Controller (MVC)\r\nKnowledge of at least one of the .NET languages (e.g. C#, Visual Basic .NET) and HTML5/CSS3\r\nFamiliarity with architecture styles/APIs (REST, RPC)\r\nUnderstanding of Agile methodologies\r\nStrong attention to detail\r\nExcellent troubleshooting and communication skills\r\nKnowledge of REST and RPC APIs\r\nAble to work well in a team setting', 'Any UG/PG in Computer Field', 'PHP, HTML,CSS, ASP.NET, AJAX, JavaScript, Email Configuration', NULL, '1-2', '15000', NULL, '2021-07-16 09:08:22', 0, ''),
(71, 'RFH00071', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'CRM Manager', 'CMD', '', 0, 'Q8Z7M00708', 'Collection Centre Head', 'Work from Site', 'Bangalore -KR Puram / Hyd- Chanderghat / Ahmedabad /', 'CIPL', '5', 'Redbelly', 'CRM', '5', 'Adminstratively Managing the Collection Centre & alos the Collection Team Members / Printing &  Logistics Team Members\r\nHe/she will be playing the Role of Centre Head cum CRM\r\nBuilding and maintaining profitable relationships with key customers.\r\nOverseeing the relationship with customers handled by your team.\r\nResolving customer complaints quickly and efficiently.\r\nKeeping customers updated on the latest products in order to increase sales.\r\nMeeting with managers in the organization to plan strategically.\r\nExpanding the customer base by upselling and cross-selling.\r\nUnderstanding key customer individual needs and addressing these.\r\nManaging the Collection Centre Team Members / Printing & Logistics Team Members', 'Any Graduation', 'Excellent interpersonal and communication skills in regional language & in Hindi / English\r\nProficient in all Microsoft applications.\r\nA team player with leadership skills.\r\nMaintain a positive attitude focused on customer satisfaction.\"', NULL, '2-3', '20000', 'Priority for Bangalore & Hyd hence we have finalized the property.\r\nother location addresses will be updated', '2021-07-16 10:19:10', 0, ''),
(72, 'RFH00072', 'On Rolls', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Swathi - Sales Head', 'CMD', '', 0, 'Q8Z7M00708', 'CRM - Manager', 'Work from Site', 'Chennai or Any region', 'CIPL', '5', 'Redbelly', 'CRM', '1', 'Monitor relationships with existing customers through CRM systems\r\nEnsure the Collection center runs properly \r\nManaging both the Collection Center head cum CRM  & Testing center CRM Associates\r\nEnsure the CRM system provides an effective sales funnel\r\nDevelop and implement marketing techniques that will drive new customers\r\nSet specific marketing strategies to retain customers\r\nPlan and manage multi-channel marketing campaigns\r\nSuggest new methods to address customersâ needs\r\nTrack marketing metrics and trends, like conversion rates and web analytics\r\nAssist with organizing promotional events to reach prospective customers\r\nConduct market research to follow trends and competition', 'Any Degree', 'A bachelorâs degree in administration or a related field.\r\nA minimum of 5 years experience & should handle a team of 4 to 6\r\nExcellent interpersonal and communication skills in Hindi / English\r\nProficient in all Microsoft applications.\r\nA team player with leadership skills.\r\nMaintain a positive attitude focused on customer satisfaction.\"', NULL, '6-7', '30000', 'Work Location based on the candidate\'s location, hence we are planning', '2021-07-16 11:29:41', 0, ''),
(73, 'RFH00073', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Naveen', 'CMD', '', 0, 'Q8Z7M00708', 'Centre Head', 'Work from Site', 'Chennai - Thiruvanmiyur / Kolkata - Near Salt Lake', 'CIPL', '5', 'Redbelly', 'Laboratory Operations', '2', 'Plan, develop, organize, implement, direct and evaluate the organization\'s laboratory operations and performance.\r\nResponsible for the overall operation and administration and P&L of the laboratory, including the employment of competent lab personnel at the city level.\r\nEnsure that testing systems developed and used for each of the tests performed in the laboratory provide quality laboratory services for all aspects of test performance, which includes the pre-analytic, analytical, and post-analytical phases of testing.\r\nEnsure that the physical plant and environment conditions of the laboratory are appropriate for the testing performed and provide a safe work environment.\r\nEnsure that the test methodologies selected have the capability of providing the quality of results required for patient care; meet accuracy standards, and lab personnel is using test methods for accurate and reliable results.\r\nEnsure that the laboratory is set up and meets all NABL / CLIA requirements including lab personnel requirements.\r\nEstablish and maintain quality control and quality assurance programs to assure the quality of laboratory services provided and to identify failures in quality as they occur along with the quality team.\r\nEnsure the establishment and maintenance of acceptable levels of analytical performance for each test system.\r\nEstablish operations standards for cost control, waste reduction, quality, safety, and complete on-time delivery.\r\nOversee the development of the organization\'s plans and programs in the evaluation of long-range planning and regulatory action on operational performance. Foster a unified culture and promotes a process for collaboration, cooperation, sharing of information, and mutual teamwork.\r\nMonitor utilization patterns of lab services and advises Leadership and other appropriate staff of developing trends in clinical service needs.\r\nEstablish and maintain lines of communication with internal and external customers in order to ensure a timely response to new clinical service trends and program planning.\r\nEnsure operational adherence to currently accepted technical service standards for laboratory medicine.\r\nEnsure operational adherence to applicable policies and procedures by all technical and operational staff.\r\nParticipate in the development and implementation of operations budget to ensure compliance with organizational expenditure requirements.\r\nAdvise, negotiate, manage and administer all contracts into which the lab may enter.\r\nLead and direct the development, communication, and implementation of effective growth strategies and processes.\r\nPerform other duties as required.', 'Any Degree', '\"A bachelorâs degree in business administration or in any related field with an exp of 4 to 6yrs in a leadership role\r\nHe should have the ability to analyze information and evaluate results in order to make the best decision in solving problems\r\nHe should have the ability to develop specific plans and goals to help in accomplishing tasks efficiently\r\nAbility to track complaints and resolve disputes and conflicts\r\nHe should be able to encourage and build team spirit among staff, bringing about mutual respect and cooperation\r\nExcellent communication in Hindi & English\"', NULL, '4-5', '40000', NULL, '2021-07-16 11:54:54', 0, ''),
(74, 'RFH00074', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Karunakaran', 'CMD', '', 0, 'Q8Z7M00708', 'Head - Logistics', 'Work from Site', 'Chennai', 'CIPL', '5', 'Redbelly', 'Logistics', '1', 'Responsible for Logistic, CFA Operation & other key support functions.\r\nOrder Dispatch/monitoring\r\nOrder Fulfillment\r\nMaintaining vendor management\r\nDispatch &logistics management\r\nLeveraging technology to set up the best processes\r\nRelationship building with Logistics partners & vendors\r\nExcellent internal & external stakeholder management skills\r\nNegotiate the price and contract commercial terms\r\nManaging stock and delivery requirements\r\nResponsible for overseeing and managing the company\'s overall supply chain and logistics strategy and operations in order to maximize process efficiency and productivity.', 'Degree in Business Admin / SCM', 'Degree in business, SCM, or related field\r\nProven working experience as a Logistics Manager with an exp of 6 + yrs\r\nRecord of successful distribution design  and sourcing & logistics management\r\nExcellent knowledge in Global Trade compliance\r\nDemonstrable ability to lead and manage staff\r\nExcellent communication in Hindi & English\"', NULL, '4-5', '40000', 'Pharma Experience \r\nShould have knowledge of Ms office Applications\r\n2-4 years of experience in Supply Chain/ Logistics/ Warehouse Operations either in Pharma or Logistics companies', '2021-07-16 12:13:06', 0, ''),
(75, 'RFH00075', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Karunakaran', 'CMD', '', 0, 'Q8Z7M00708', 'Purchase Head', 'Work from Site', 'Chennai', 'CIPL', '4', 'Redbelly', 'Purchase - Laboratory', '1', '- Develop, lead and execute purchasing strategies\r\n\r\n- Track and report key functional metrics to reduce expenses and improve the effectiveness\r\n\r\n- Craft negotiation strategies and close deals with optimal terms\r\n\r\n- Partner with stakeholders to ensure clear requirements documentation\r\n\r\n- Forecast price and market trends to identify changes of balance in buyer-supplier power\r\n\r\n- Perform cost and scenario analysis, and benchmarking\r\n\r\n- Assess, manage and mitigate risks\r\n\r\n- Seek and partner with reliable vendors and suppliers\r\n\r\n- Determine quantity and timing of deliveries\r\n\r\n- Monitor and forecast upcoming levels of demand\r\n\r\n- Release of all Opex related Purchase orders\r\n\r\n- Procurement of Biologicals & Consumables\r\n\r\n- Liaison with Regulatory Authorities\r\n\r\n- To arrange for vendor approval after obtaining of duly filled in Vendor Questionnaire\r\n\r\n- Ensure timely, cost-effective, and high-quality materials adhering to all purchase policies and regulatory guidelines.\r\n\r\n- Review and approval of Stores Records\r\n\r\n- Experience in import and its related formalities to ensure timely clearance) delivery of imported Goods (Lab equipment and chemical/consumables)', 'Any relevant Degree', 'Degree in business, marketing, communications, or related field with an exp of 6+ yrs\r\nDemonstrable experience of leading a purchasing function with a proven track record in strategic purchasing leadership delivering effective purchasing strategies, policies, processes, and systems \r\nAbility to add value, reduce costs and make business improvements \r\nProven contract management and supplier experience \r\nExperience in operating and influencing at a strategic level\r\nExcellent communication in Hindi & English\"', 'Detail Knowledge material procurement etc.\r\nGenerating, updating, and monitoring material schedules, coordinating with Project\r\nManager and site Engineerâs ensuring supply to the sites on time.\r\nLiaisoning with Store so as to maintain optimum stock in the store for the project.\r\nVendor Development and Market Research\r\nResponsible for Purchase of Materials (Electrical/Instrumentation/Mechanicals), Consumables, Structural materials, Chemicals, Fire &amp; Safety items, Laboratory, etc.\r\nFollow up Vendors for Quote and Material Delivery, Prepare comparison statement\r\nResponsible for preparing orders and issuing signed copies to the vendor.\r\nShould have knowledge of ISO.\r\nGood communication and confidence', '3-4', '60000', NULL, '2021-07-16 12:46:22', 0, ''),
(76, 'RFH00076', 'Activity Outsourcing to HEPL', 'Markose N', '9841524164', 'markose@hemas.in', 'Kamiya', 'Usha Guru', '', 0, '123', 'Inside Sales Executive', 'WFH', NULL, 'HEPL', '5', '', 'Inside sales', '1', 'Cold calling, B2C & B2B lead generation, Identifying prospects, curation, lead conversion', 'Any graduate', 'Cold calling, Convert leads into sales', 'Effective communication over the phone and email', '2-3', '18000', 'Language - English & Hindi must', '2021-07-17 08:23:30', 0, ''),
(77, 'RFH00077', 'Manpower Outsourcing to HEPL', 'Arun Christy', '9677139892', 'arunchristy@cavininternational.com', 'Self', 'Karunakaran', 'Screenshot_(6).png', 0, NULL, 'Printing & Logistics Associate', 'Work from Site', 'Thiruvanmiyur', 'CIPL', '5', 'Redbelly', 'Data Entry', '2', 'Maintains database by entering new and updated customer and account information. \r\nPrepares source data for computer entry by compiling and sorting information. \r\nEstablishes entry priorities. \r\nResolves deficiencies by using standard procedures or returning incomplete documents to the team leader for resolution. \r\nVerifies entered customer and account data by reviewing, correcting, deleting, or reentering data. \r\nPurges files to eliminate duplication of data. \r\nTests customer and account system changes and upgrades by inputting new data. \r\nSecures information by completing database backups. \r\nMaintains operations by following policies and procedures and reporting needed changes. \r\nMaintains customer confidence and protects operations by keeping information confidential. \r\nContributes to team effort by accomplishing related results as needed.', 'Any degree', 'Communication (Oral & Written) / -Type writing Data Entry / Positive Thinking / Work Ethic / Application knowledge in Ms office (Outlook / Excel & PPT)\r\nLanguage - Bengali / Hindi & English Must', 'Language - Bengali / Hindi & English Must', 'less than 1', '12000', 'Need Male candidate with excel knowledge & need to have a bike.', '2021-07-17 10:37:35', 0, ''),
(78, 'RFH00078', 'On Rolls', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Self', 'Karunakaran', 'Screenshot_(6)1.png', 0, NULL, 'HR CIPL', 'Work from Site', 'For the Initial training Period, he will be deployed in Injambakkam, Chennai later will be moved to Cuddalore - Devanampatinam', 'CIPL', '5', 'Corporate', 'Recruitment & HR Generalist', '1', 'Handling the entire Recruitment Process.\r\nSourcing candidates through Portals, consultancy, Sources, etc\r\nManaging the entire Attendance portals & Payroll system\r\nOrganize & conduct Training & Development Program as per business requirements\r\nOrganizing Employee engagement activities', 'MSW-HRM or any related trade', 'Candidates well versed with job portals Screening/ Interviewing Skills\r\nCandidates with good English communication skills.\r\nCandidates should have proficiency in MS (word, excel, PowerPoint) and the Internet.', 'Basic Knowledge in various Cross-functional departments', '2-3', '22000', 'Salary will be based on the Last CTC / this role is for Farm business Birds / Dairy & Agri.', '2021-07-17 11:27:50', 0, ''),
(79, 'RFH00079', 'Activity Outsourcing to HEPL', 'Jayanthi S', '9500098000', 'jayanthi.s@hemas.in', 'Jayanthi', 'Usha Guru', '', 0, '123456', 'Designer', 'Work from Site', NULL, 'HEPL', '5', '', 'Graphics Team', '7', ', Work from Site - 2 shifts - only  7 am to 4 p.m & 4 p. m to 9 p.m (Part time)\r\n\r\nSalary for the 2nd team will be accordingly fixed\r\n\r\nThey will be initially in the Team lease payroll (no PF, only insurance) and the top 5 or 6 will be absorbed in HEPL payroll at the end of 3rd month', 'Any design degree', 'ADOBE PHOTOSHOP \r\nADOBE ILLUSTRATOR\r\nADOBE PREMIERE PRO\r\nBASIC DRAWING SKILL', NULL, '2-3', '10000', NULL, '2021-07-19 12:48:02', 0, '');
