(83, 'RFH00083', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'SELF', 'Usha Guru', '', 0, NULL, 'Art Director', 'WFH', NULL, 'HEPL', '5', '', 'Creative Design', '1', 'JD- Art Director\r\nResponsibilities:\r\nâ¢ Generate clear ideas and concepts in tandem with the copywriter\r\nâ¢ Produce sketches, storyboards, roughs to visualize ideas\r\nâ¢ Understand marketing initiatives, strategic positioning and target audience\r\nâ¢ Cooperate with the rest of the creative team across different types of media\r\nâ¢ Take work from concept to final execution within deadlines\r\nâ¢ Manage and delegate responsibilities to other designers and provide directions\r\nâ¢ Present completed ideas to clients/team members\r\nâ¢ Stay on top of all trends and maintain best practices\r\nâ¢ Stay on top of all trends and maintain best practices\r\nâ¢ Produces art layouts by developing art concepts and providing work direction to staff.\r\nâ¢ Trains, assigns, schedules, and coaches employees.\r\nâ¢ Meets art department work standards by following production, productivity, quality, and customer service standards.\r\nâ¢ Resolves operational problems.\r\nâ¢ Identifies work process improvements.\r\nâ¢ Formulates art concepts by supervising team members engaged in executing layout designs for artwork and copy to be presented by visual communications media.\r\nâ¢ Reviews project production factors by studying budget, background information, objectives, presentation approaches, styles, and techniques.\r\nâ¢ Selects and secures illustrative material by formulating basic layout design concepts and conducting research.\r\nâ¢ Obtains approval by presenting final layouts, storyboards, and illustrations; and responds to client commentary and requests from department & Business Head.\r\nâ¢ Improves quality results by studying, evaluating, and re-designing processes.\r\nArt Director Skills and Qualifications:\r\nâ¢ Coordination\r\nâ¢ Creativity\r\nâ¢ Vision\r\nâ¢ Project management\r\nâ¢ Graphic design skills\r\nâ¢ Developing creative standards\r\nProficiency with illustration tools\r\nâ¢ Desktop publishing skills\r\nâ¢ Multimedia content development\r\nâ¢ Education and Experience Requirements:\r\nâ¢ Bachelorâs degree in an art, fine arts or design\r\nâ¢ 5 years of experience as an art director or creative director\r\nâ¢ 3 years within an agency environment\r\nâ¢ Background in Keynote, Google Suite, Powerpoint, and Adobe Creative Suite (Photoshop, After Effects, Illustrator, Premiere, and Animate)', 'Graduation in Fine Arts', 'â¢ Desktop publishing skills\r\nâ¢ Multimedia content development\r\nâ¢ Education and Experience Requirements:\r\nâ¢ Bachelorâs degree in an art, fine arts or design\r\nâ¢ 5 years of experience as an art director or creative director\r\nâ¢ 3 years within an agency environment\r\nâ¢ Background in Keynote, Google Suite, Powerpoint, and Adobe Creative Suite (Photoshop, After Effects, Illustrator, Premiere, and Animate)', 'â¢ Coordination\r\nâ¢ Creativity\r\nâ¢ Vision\r\nâ¢ Project management\r\nâ¢ Graphic design skills\r\nâ¢ Developing creative standards', '1-2', '25000', NULL, '2021-07-26 08:39:59', 0, ''),
(84, 'RFH00084', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'SELF', 'Usha Guru', '', 0, NULL, 'Creative Deisgner', 'WFH', NULL, 'HEPL', '5', '', 'Digital Marketing', '2', 'JD- Creative Designer\r\nResponsibilities: -\r\nâ¢ Conceptualizing visuals based on requirements\r\nâ¢ Creating images and layouts by hand or using design software\r\nâ¢ Testing graphics across various media\r\nâ¢ Study design briefs and determine requirements\r\nâ¢ Schedule projects and define budget constraints\r\nâ¢ Conceptualize visuals based on requirements\r\nâ¢ Prepare rough drafts and present ideas\r\nâ¢ Develop illustrations, logos and other designs using software or by hand\r\nâ¢ Use the appropriate colors and layouts for each graphic as per color psychology charts\r\nâ¢ Work with copywriters and creative director to produce final design\r\nâ¢ Test graphics across various media\r\nâ¢ Amend designs after feedback\r\nâ¢ Ensure final graphics and layouts are visually appealing and on-brand\r\nRequirement: -\r\nâ¢ Proven graphic designing experience\r\nâ¢ A strong portfolio of illustrations or other graphics\r\nâ¢ Familiarity with design software and technologies (such as InDesign, Illustrator, Dreamweaver, Photoshop)\r\nâ¢ A keen eye for aesthetics and details\r\nâ¢ Excellent communication skills\r\nâ¢ Ability to work methodically and meet deadlines\r\nâ¢ Degree in Design, Fine Arts or related field is a plus', 'Graduation in Fine Arts', 'â¢ Proven graphic designing experience\r\nâ¢ A strong portfolio of illustrations or other graphics\r\nâ¢ Familiarity with design software and technologies (such as InDesign, Illustrator, Dreamweaver, Photoshop)\r\nâ¢ A keen eye for aesthetics and details\r\nâ¢ Excellent communication skills\r\nâ¢ Ability to work methodically and meet deadlines\r\nâ¢ Degree in Design, Fine Arts or related field is a plus', NULL, '3-4', '25000', 'CTC-2 to 3 lacs', '2021-07-26 08:43:33', 0, ''),
(85, 'RFH00085', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'SELF', 'Usha Guru', '', 0, NULL, 'Associate Content/Meme/Blog Writers', 'WFH', NULL, 'HEPL', '5', '', 'Digital Marketing', '2', 'JD- Content Writer\r\nJob Responsibilities\r\nâ¢ Think memes on trending topics and relevant humour content for social media accounts of HEPL clients - from videos to social media\r\nâ¢ Write scripts for creators to create reels / short format funny videos\r\nâ¢ This is not a dud job of churning out quote-cards. You will be expected to create viral social media content.\r\nâ¢ Draft caption for daily social media posts\r\nâ¢ Your writing skills in English will be an important criterion along with your knowledge of Indian trending topics and sense of humour.\r\n\r\nâ¢ You will be expected to keep yourself up-to-date with -\r\nâ¢ Tech, analytics &; trends on social media\r\nâ¢ Global & Indian content scene from top-notch brands, creators to brands\r\nRequirements\r\nâ¢ Should have a degree/diploma in Fine arts or Mass media, Journalism or Creative Writing with 1-3yrs of work experience with - known design & communication firms, reputed fashion Publications or Advertising agencies.\r\nâ¢ Passion for youth pop culture - have a solid knowledge of the cool-culture movements, trending memes, Bollywood, Hollywood and viral news, sports etc.\r\nâ¢ Should have a good knowledge on tending creators.\r\nâ¢ Great language sensibility is absolutely essential. But the applicant also needs to match it with fast turnaround time, enthusiasm, energy and capability to handle high work pressure and tight deadlines.\r\nScreening test: Mandatory\r\n1. Please share your fav meme with us\r\n2. Share a recent video you watched\r\n3. Your TOP 5 accounts / creators on social media (Insta / facebook/snapchat/pinterest/other)\r\n4. Please create:\r\nâ¢ 2 memes - one for Chik Shampoo / one for Cavinâs Milkshake\r\nâ¢ Write a script for a funny Video youâd love to do for a creator on Sanchu Animal Hospital on topic of Indians & Podcasts', 'Mass Media, Journalism', 'â¢ Should have a degree/diploma in Fine arts or Mass media, Journalism or Creative Writing with 1-3yrs of work experience with - known design & communication firms, reputed fashion Publications or Advertising agencies.\r\nâ¢ Passion for youth pop culture - have a solid knowledge of the cool-culture movements, trending memes, Bollywood, Hollywood and viral news, sports etc.\r\nâ¢ Should have a good knowledge on tending creators.\r\nâ¢ Great language sensibility is absolutely essential. But the applicant also needs to match it with fast turnaround time, enthusiasm, energy and capability to handle high work pressure and tight deadlines.', NULL, '2-3', '18000', 'Screening test: Mandatory\r\n1. Please share your fav meme with us\r\n2. Share a recent video you watched\r\n3. Your TOP 5 accounts / creators on social media (Insta / facebook/snapchat/pinterest/other)\r\n4. Please create:\r\nâ¢ 2 memes - one for Chik Shampoo / one for Cavinâs Milkshake\r\nâ¢ Write a script for a funny Video youâd love to do for a creator on Sanchu Animal Hospital on topic of Indians & Podcasts', '2021-07-26 08:48:50', 0, ''),
(86, 'RFH00086', 'Manpower Outsourcing to HEPL', 'Pranay V', '9072319193', 'pranayv@cavinkare.com', 'Self', 'Rajesh', 'Virtual_Supervisor_Approval.pdf', 0, '', 'Virtual Supervisor - Factory HR', 'WFH', 'South Indian', 'CKPL', '4', 'Personal Care', 'Human Resource', '1', '1. Reviewing the Factory HR Routines.\r\n2. Reviewing of Day to Day Priorities.\r\n3. Updation and Appraising the big tickets to supervisor\r\n4. Analytics of Plant HR Work and Time Sheet and coming with actionables\r\n5. Work on Innovation and Projects with supervisor\r\nLanguage: Tamil/Malayalam/Hindi, English\r\n', 'MSW/MBA HR', '1. Handled Factory HR Role \r\n2. Communication Skills\r\n3. HR Generalist with Fair Idea on End to End HR\r\n4. Driving Excellence \r\n', 'Worked on Automation\r\nWorked on Productivity Projects', '3-4', '600000', 'Nil', '2021-07-27 04:57:16', 0, ''),
(88, 'RFH00088', 'Manpower Outsourcing to HEPL', 'Pranay V', '9072319193', 'pranayv@cavinkare.com', 'Nandkumar', 'Elango', 'Logistics.pdf', 0, '', 'Customer Care Executive ', 'WFH', 'WFH Chennai', 'CKPL', '4', 'Personal Care', 'Logistics', '1', 'All Kind of customers (distributors) for all divisions PC, Raaga, AB & AD, F&S: -\r\nâ¢ GT(Distributors)\r\nâ¢ MT (Distributors)\r\nShould have knowledge about SNOP, Stock Norms, replenishment, data analytics,  \r\nElaborated JD: - \r\n1. Replenishment process execution    \r\n2. Stock as per SAP/Botree/Cavincomm \r\n3. Stock availability (with planning) for replenishment. \r\n4. Regular calls to Distributors asking for issues interms of the replenishment & other specifics like E-POD, vehicle tracking, routing, PDP, POD, CN, transport & other logistics related issues. \r\n5. Manually Excel based distributor issues tracking\r\n6. Resolving distributor stock related issues\r\n7. Getting regular feedback from Distributors. \r\n8. Updating with daily MIS. \r\n9. Communications with sales team, RDC team. Management related aspects of replenishment. \r\n10. Material Master rectification for PO. \r\n', 'Any Bachelor Degree', 'SAP Knowledge', '', '3-4', '400000', '', '2021-07-27 05:08:28', 0, ''),
