(103, 'RFH00103', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'Self', 'Usha Guru', '', 0, '123456', 'Associate- Social Media', 'WFH', NULL, 'HEPL', '5', '', 'Digital Marketing', '9', 'â¢ Write compelling, social-friendly, impeccable copy for content that reflects our clients voice and values.\r\nâ¢ Audit existing social presence to inform and build a targeted strategy for growth\r\nâ¢ Track, analyze, and report data and insights on our growth and engagement to support all strategic decisions\r\nâ¢ Partner with other editorial teams to launch and manage creative social campaigns that support on-site content and larger brand initiatives\r\nâ¢ Collaborate with value-aligned social influencers, industry experts, brands, organizations to coordinate promotions\r\nâ¢ Engage with our social communities daily through comments and DMs across platforms\r\nâ¢ Align with software development teams to adapt to ever-changing social media trends, tools, and usage patterns.', 'Any degree', 'â¢ Proactive, creative, flexible team player with a good sense of humor and entrepreneurial spirit, able to roll with the punches and take ownership of responsibilities in a fluid and fast-moving environment\r\nâ¢ Passionate about high-tech (including an interest in science and engineering) topics and always eager to share and learn more\r\nâ¢ Expert-level proficiency with writing, editing, and curation of content for brands on social networks such as Linkedin, Instagram, Pinterest, Facebook, Snapchat, Tumblr, Flipboard and other emerging social platforms', 'â¢ Experience with social media schedulers and analytics tools (e.g., Buffer, Sprout Social, Tailwind, Google Analytics, etc.)\r\nâ¢ Ability to accurately interpret social analytics and report to senior management\r\nâ¢ A strong visual design sense and experience capturing and editing photos and videos for social-only use, specifically, for Instagram and Instagram Stories\r\nâ¢ Adept in 