(115, 'RFH00115', 'On Rolls', 'A Mohan', '9962983044', 'amohan@CavinKare.com', 'A Mohan', 'Selvaraj', '', 0, '123456', 'Senior Purchase Officer', 'Work from Site', 'Kanchipuram', 'CKPL', '5', 'Raaga', 'Purchase', '1', 'Provides guidance and assistance to faculty and staff in all aspects of purchasing.\r\nEnsures that all purchasing is in compliance with regulations and laws related to.\r\npurchasing practices and in accordance with Red Deer College standard practices.\r\nPrepares technical specifications for request for proposals, including terms and conditions and evaluation criteria.\r\nPrepares and develops bid documents and supplier bid lists to obtain competitive quotations on commodities and services\r\nPromotes the Purchasing section as an effective resource for addressing Supply to Management issues.\r\nKeeps constantly apprised of economic / business situations as they affect purchasing policy; makes recommendations to adequately meet those changing conditions.\r\nDevelops and updates department procedures and recommends changes to related college standard practices; interprets policies and procedures to faculty and staff in their need to purchase supplies and services.\r\nAnalyzes current procurement activities and recommends improvement through more efficient procurement methods, quantity discounts, standardization, value analysis and cooperative purchasing.', 'Any Degree', 'Solicits information regarding a variety of commodities by telephone, facsimile, interview or written requests ensuring cost effectiveness commensurate with quality.\r\nReviews tenders and purchase award documentation with respect to quality, suitability, delivery and pricing.\r\nResponsible for awarding a contract with consensus from the respective department.\r\nResponsible for the development and administration of the awarded contract.\r\nPrepares and maintains accurate records and documentation on all solicitations,\r\nresponses, purchases, contracts, correspondence and related follow up.\r\nExpedites outstanding purchase orders to ensure delivery requirements are met.\r\nPromotes and develops contact and liaison with the external supplier community and\r\nInterviews current suppliers to improve levels of service and new suppliers to develop and establish new sources of supply.\r\nCollects and reports statistics to measure commodity and/or supplier performance.\r\nPrepares reports to ensure compliance with related laws and regulations..\r\nCoordinates and resolves problems with end user departments and suppliers.\r\nAssist in resolving Accounts Payable invoice discrepancies and variances after Accounts Payable make initial inquiry.\r\nAssists Shipping and Receiving with shipment /transportation related discrepancies and variances.\r\nPerforms other related duties such as special assignments and annual major objectives as required.', 'SAP \r\nExperience: 5 to 12 Years', '5-6', '38852 ', ' Male candidates only, age limit below 40, Industry - Dairy\r\nCV Share to \r\nTo: palayathan@cavinkare.com (John),  Cc:amohan@CavinKare.com, selvaraj@CavinKare.com, pranayv@cavinkare.com', '2021-08-09 05:03:46', 0, ''),
