(121, 'RFH00121', 'Activity Outsourcing to HEPL', 'Prijith R', '8921058940', 'prijith.r@hemas.in', 'Self', 'Pradeesh', '', 0, '12345', 'Team Leader Operation', 'WFH', 'Anywhere', 'HEPL', '5', '', 'Opearations', '1', 'â¢ Monitor calls to ensure that due procedures and quality standards are strictly adhered . \r\nFeedback to be shared to VSS based on observations. In case of any absence in audit for any particular day, to be done along with next dayâs audit. The excuse can be happening for a maximum of one day and with approval only).  \r\nâ¢ Understand all organizationâs products, services, procedures and guidelines and communicate same to all team members. ( Prepare a individual Update Tracker for updates on a date wise manner and also check the understanding of changes on a realtime and periodic manner)\r\nâ¢ Conduct regular review of all call center agents performance and organize training sessions for under performers(Weekly and monthly review planner to be followed and documented)\r\nâ¢ Ensure a safe and harmonious working environment for all other team members and delegate duties to all team members (Periodic checks to be conducted in a survey mode to understand the Direct Reports are Satisfied)\r\nâ¢ Provides continual evaluation of processes and procedures. Responsible for suggesting methods to improve area operations, efficiency and service to both internal and external customers. (Be a part of organizational calls and team meetings and provide suggestions)\r\nâ¢ Addresses disciplinary and/or performance problems according to company policy. (Have a clear understanding of all HR policies and download to Direct Reports)\r\nâ¢ Ability to drive process, performance & transformation\r\nâ¢ Maintain delivery dashboards with analysis ( Attend Management reviews with readily prepared data pertaining to respective team)\r\nâ¢ Handle escalated calls, complaints, questions, and queries, as required (Document all escalations which are handled from Leadership Level along with the TAT assigned) \r\nâ¢ Work along with Quality function and prepare TNI based on specific requirements ( Periodic calibrations and meetings with support functions and get into mutual agreement on TNI or any other planning)\r\n\r\nKey Deliverables (KRA/Measure)\r\n\r\nâ¢ To manage the dayâto-day planning, operations, problem-solving of the team and to meet the required Key Performance Index\r\nâ¢ People Management including conflict management as well as staff development\r\nâ¢ Operational Management: Managing the floor, adherence to schedule\r\nâ¢ Call monitoring, coaching and feedback, responsibility for delivery of the defined customer experience in every call\r\nâ¢ Training and development of Agent\r\nâ¢ Motivation, leadership for his team and developing future leaders\r\nâ¢ Recommendations for product and process development based on customer feedback and analysis of the same\r\nâ¢ Conducting performance appraisal and providing feedback to the team members\r\nâ¢ Compiling reports on teamâs performance and customer feedback\r\nâ¢ Delivery of team service level components, quality, productivity targets & indicators', 'Degree', 'Tamil, Hindi English\r\nExcel Skills\r\nComputer Knowledge\r\nPrior Team Handling Experience', NULL, '3-4', '25000', NULL, '2021-08-10 06:16:44', 0, ''),
(123, 'RFH00122', 'Activity Outsourcing to HEPL', 'Pradeesh N', '9840433537', 'pradeeshn@cavinkare.com', 'Self', 'Usha Guru', '', 0, '12345', 'Team Leader- MIS /Business Analyst /Transition Lead', 'Work from Site', 'Cuddalore', 'HEPL', '5', '', 'MIS', '1', 'Roles And Responsibilities\r\nâ¢ Should have experience working with BI Tool/ Data visualization tools/ Advanced Excel/ Power BI/ SQL/ VBA Macro\r\nâ¢ Provide support and maintenance to existing management information systems (MIS).\r\nâ¢ Generate/ auotmate and distribute management reports in accurate and timely manner.\r\nâ¢ Develops MIS documentation to allow for smooth operations and easy system maintenance.\r\nâ¢ Develop/Automate MIS system for customer management and internal communication.\r\nâ¢ Provide strong reporting and analytical information support to management team.\r\nâ¢ Analyze business information to identify process improvements for increasing business efficiency and effectiveness.\r\nâ¢ Participate in cross-functional meetings to resolve recurring customer issues.\r\nTransition Lead- MIS Lead Team handling experience .', 'Bachelors degree in computer science, MIS, engineering, information technology, or a related field.', 'A minimum of 4 years as Business / MIS Analyst\r\nâ¢ Microsoft Office Suite (Excel, Word, PowerPoint)\r\nâ¢ Business process automation tools- Ex: Power BI, VBA MACRO, SQL \r\nâ¢ Data analysis tools- Data Visualization tools \r\nâ¢ Data modeling (need to know how to integrate data from multiple sources according to standards and best practices)\r\nâ¢ Data analytics businesses depend on MIS analysts to make sense of data and statistics in order to understand the best strategies to apply.', 'Good analytical skills,Team handling, Good Communication Skills.', '4-5', '66K', 'Salary 8-12 LPA', '2021-08-10 10:07:59', 0, ''),
