nd Brand Portfolio\r\nï· Knowledge of Customers, Market and Competitors\r\nï· Deep understanding of E-Commerce & Social Media\r\nï· Constant urge to learn, unlearn, ideate and execute new things', 'Behavioral Competencies:\r\nï· Strategic Thinking: Focusing and driving results for self and others, creating and\r\ncommunicating a long - term strategy\r\nï· Handling Ambiguity: Being proactive, setting the pace and being flexible, creating a sense\r\nof urgency by being energetic, curious and passionate about tasks at hand\r\nï· Driving Innovation through Experimentation: Being entrepreneurial, creative problem\r\nsolving, relentless follow through and monitoring of processes', '2-3', '20000', 'Experience Required: 2 â 3 years of Experience in an ecom / digital startup preferred.\r\nCTC Check with team.\r\nRFH Team, position created manually to assign for recruiters. CTC check with team.', '2021-08-23 11:07:11', 0, ''),
