(187, 'RFH00187', 'On Rolls', 'Pranay V', '9072319193', 'pranayv@cavinkare.com', 'Selvaraj T', 'Ravishankar N', 'RFH_Erode.pdf', 0, NULL, 'Plant Head', 'Work from Site', 'Tamil Nadu', 'CKPL', '4', 'Ambient & Beverage', 'Manufacturing', '1', 'Grade - Deputy Manager/Manager\r\nExperience - 10-12 Years\r\nQualification - BE Mechanical/BE EEE/ MBA Operations\r\nMust Require Skills:\r\nLead the Team of Minimum 5 to 6 Members as a Lead - Collaboration & Direction\r\nCommunication - Open, Transparent, Clear, Motivation\r\nTechnical - Worked in FMCG preferrable with experience in Handling Operations ( Production, Maintenance, Process) with understanding QA and Logistics\r\nBehavioral - Ownership Mindset, Urge to Learn, Urge to Grow, Urge to take Initiatives\r\nAge - Withing 30 -34 Years\r\nLanguage - Preferrable he is aware of Tamil \r\nReporting to - Selvaraj Cluster Head ABC\r\nLocation: Erode\r\nLanguage: tamil must', 'BE Mechanical/BE EEE/ MBA Operations', 'Lead the Team of Minimum 5 to 6 Members as a Lead - Collaboration & Direction\r\nCommunication - Open, Transparent, Clear, Motivation\r\nTechnical - Worked in FMCG preferrable with experience in Handling Operations ( Production, Maintenance, Process) with understanding QA and Logistics\r\nBehavioral - Ownership Mindset, Urge to Learn, Urge to Grow, Urge to take Initiatives', NULL, '>10', '120000', NULL, '2021-09-02 05:36:38', 0, ''),
(188, 'RFH00188', 'Activity Outsourcing to HEPL', 'Aishwaryaa B', '9894441172', 'aishwaryaa.b@hemas.in', 'SELF', 'Usha Guru', 'Capture52.PNG', 0, NULL, 'ML(Machine Learning) Developer', 'Work from Site', 'Cuddalore\r\nPondicherry', 'HEPL', '5', '', 'IT', '2', 'Proven experience as a Machine Learning Engineer or similar role\r\nUnderstanding of data structures, data modeling and software architecture\r\nDeep knowledge of math, probability, statistics and algorithms\r\nAbility to write robust code in Python, Java and R\r\nFamiliarity with machine learning frameworks (like Keras or PyTorch) and libraries (like scikit-learn)\r\nAbility to work in a team\r\nOutstanding analytical and problem-solving skills', 'Any UG / PG degree in IT', 'Keras, PyTorch', NULL, '1-2', '30000', NULL, '2021-09-02 10:43:12', 0, ''),
(189, 'RFH00189', 'Activity Outsourcing to HEPL', 'Aishwaryaa B', '9894441172', 'aishwaryaa.b@hemas.in', 'SELF', 'Usha Guru', 'Capture53.PNG', 0, NULL, 'AI(Artificial Intelligence) Developer', 'Work from Site', 'Cuddalore\r\nPondicherry', 'HEPL', '5', '', 'IT', '2', 'An Artificial Intelligence developer plays a key role in using algorithms and\r\nneural networks to build usable solutions for business.  \r\n\r\nJob description: Important responsibility is to design, develop, enhance and implement AI solutions.\r\nMachine Learning Engineer Skills: AI, ML, NLP, REST APIs, libraries, frameworks, R, Pythons and C#.\r\nAdditional Skills: Design, development and deployment of cloud application.', 'Any UG / PG degree in IT', 'Python, C#', NULL, '1-2', '30000', NULL, '2021-09-02 10:47:00', 0, ''),
(190, 'RFH00190', 'Activity Outsourcing to HEPL', 'Aishwaryaa B', '9894441172', 'aishwaryaa.b@hemas.in', 'SELF', 'Usha Guru', 'Capture54.PNG', 0, NULL, 'RPA(Robotic Process Automation)', 'Work from Site', NULL, 'HEPL', '5', '', 'IT', '2', 'Developers are required to demonstrate a variety of both soft and hard skills.\r\n Some of the key abilities required for this role include:\r\n\r\nAutomation tools, such as Blue Prism, UI Automation or UiPath\r\nProficiency in programming languages, such as C, C++, Java, Python or .NET\r\nBasic knowledge of Machine Learning (ML) and Artificial Intelligence (AI)\r\nExperience with Databases, such as SQL and NoSQL', 'Any UG/PG degree in IT', 'C, C++, Java', NULL, '1-2', '30000', NULL, '2021-09-02 10:51:30', 0, ''),
