(201, 'RFH00201', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Lakshmikanth', 'CKR', 'Screenshot_(25).png', 0, NULL, 'Senior Officer', 'Work from Site', 'Chennai, Kancheepuram & Cuddalore', 'CIPL', '5', 'Projects (CIPL)', 'Civil Engineering', '1', 'Responsibilities:\r\nFor Civil Engineer:\r\n\r\ndesign systems and products\r\nread design specifications and technical drawings\r\nresearch suitable solutions and estimate costs and timescales\r\nmake models and prototypes of products using three-dimensional design software\r\nliaise with others in the design team\r\ncommunicate with clients and contractors\r\nattend meetings on-site\r\nprepare product documentation, write reports and give presentations\r\nmonitor a product in use to improve on future design.\r\nidentify customer requirements & Individually should be capable to execute the civil & interior project assignments both in onsite and remote mode; Capable to handle multiple projects at a time', 'Diploma & Engineering', 'Project Management\r\nLayout Design\r\nSite Engineering\r\nSurvey & Estimation\r\nProcurements\r\nBudget & Forecasting\r\nQuality Control', 'Key Result Areas: \r\n\r\nManaging Minimum 3 to 5  projects , including in-house, external contractors and sub-contractors; attending meetings and discussing project details with clients, contractors and stakeholders\r\nDeveloping project baselines; monitoring & controlling projects with respect to cost, resource deployment, time over-runs and quality compliance\r\nPreparing monthly reports detailing progress on engineering, procurement, marketing commissioning activities\r\nCoordinating with the customer & consultants for drawings and approvals', '5-6', '35K', 'compensation will be based upon the last drawn salary.  salary take home 30K..', '2021-09-09 09:58:56', 0, ''),
(202, 'RFH00202', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Lakshmikanth', 'CKR', 'Screenshot_(25)1.png', 0, NULL, 'Senior Officer', 'Work from Site', 'Chennai, Kancheepuram & Cuddalore', 'CIPL', '5', 'Projects (CIPL)', 'Electrical Engineering', '1', 'Responsibilities:\r\n\r\nFor Electrical Engineer:\r\n\r\ndesign systems and products\r\nread design specifications and technical drawings\r\nresearch suitable solutions and estimate costs and timescales\r\nmake models and prototypes of products using three-dimensional design software\r\nliaise with others in the design team\r\ncommunicate with clients and contractors\r\nattend meetings on-site\r\nservice and maintain equipment\r\nprepare product documentation, write reports and give presentations\r\nmonitor a product in use to improve on future design.\r\nidentify customer requirements &  Should be capable of designing electrical/plumbing circuits for a site based on layout input; Capable to handle multiple projects at a time', 'Diploma & Engineering', 'Core Competencies:\r\n\r\nrelevant technical knowledge and up-to-date sector knowledge\r\nproject management skills\r\ncommercial awareness\r\nan analytical and problem-solving approach to work\r\noral and written communication skills to make technical information easy to understand for non-technical audiences\r\nflexibility in order to adapt to evolving technologies\r\nplanning and organisational skills, such as time and resource allocation\r\nthe ability to work in a multidisciplinary team\r\nleadership and management skills to help with career progression', 'Managing Minimum 3 to 5  projects , including in-house, external contractors and sub-contractors; attending meetings and discussing project details with clients, contractors and stakeholders\r\nDeveloping project baselines; monitoring & controlling projects with respect to cost, resource deployment, time over-runs and quality compliance\r\nPreparing month