(209, 'RFH00209', 'Activity Outsourcing to HEPL', 'Aishwaryaa B', '9894441172', 'aishwaryaa.b@hemas.in', 'SELF', 'Usha Guru', '', 0, '123456', 'Â Android app Developer', 'Work from Site', NULL, 'HEPL', '5', '', 'IT', '1', 'App developer with 1+ years experience in  IOS and Android development. Native frameworks knows SMS/payment gateway integrations. Programming languages like C/C#/JAVA/Objective-C/Swift develop application programming interfaces (APIs) to support mobile functionality.  use and adapt existing web applications for apps familiarity with OOP design principles. experience with third party libraries and APIs.', 'Any UG / PG in IT', 'Programming languages like C/C#/JAVA/Objective-C/Swift develop application programming interfaces (APIs) to support mobile functionality.  use and adapt existing web applications for apps familiarity with OOP design principles. experience with thirdparty libraries and APIs.', NULL, '2-3', '18000', 'immediate joiners expected..,', '2021-09-14 13:35:32', 0, ''),
