(211, 'RFH00211', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Karunakaran', 'CKR', '', 0, 'Q8Z7M00708', 'Sales Manager', 'Work from Site', 'Chennai/Bangalore', 'CIPL', '4', 'Redbelly', 'Sales PAN India', '1', 'Achieve or exceed the sales goals established by the company\r\nAttain/exceed the business objectives related to specific existing accounts, development of new accounts, and penetration of targeted market segments or introduction of new products\r\nDocument all sales activities, including customer communications and sales development updates, by entering the information in the company Customer Relationship Management (CRM) database on a daily/weekly basis\r\nFollow up on high-value sales leads promptly; document all actions and communications in the CRM\r\nWith the assistance of and in coordination with Corporate Communications and Marketing, develop and implement a territory promotions plan that results in sales and market share growth\r\nCoordinate (and sometimes participate in) sales meetings, trade shows, and training seminars as requested by distributors and/or company management\r\nConduct and/or assist in technical product demonstrations and trials to key decision makers, end users, or distributors\r\nSubmit special price quotation requests for new high-value opportunities to support distributorsâ selling efforts ensuring all required information is included and that company procedures are followed; ASM must manage quote expiration dates and ensure that all price quotations vital to the continued growth of our business are renewed in a timely manner with the support of our inside sales support team\r\nUnder direction of the Regional Sales Manager, develop sales and routing plan\r\nSubmit regular reports on sales progress, key account activity, and general business analysis to the Regional Sales Manager\r\nDevelop and continuously improve business relationships with field sales and management representatives from Distribution and other channel partners\r\nWilling to Travel', 'Bachelorâs Degree required (focus in Science or Business preferred) 5 yearsâ sales experience in industry (Life Sciences / Research / Biopharma / Biotech) Bachelorâs Degree 5 years of sales experience in industry (Life Sciences / Research / Biopharma / Bi', 'Leadership and decision making in adjusting strategy to account for local factors or market shifts\r\nStrategic Selling/sophisticated selling skills\r\nSuperior communication skills and proven ability to work optimally in a matrix environment with multiple partners\r\nResults-oriented\r\nAbility to lead without authority to achieve sales goals\r\nStrong interpersonal skills\r\nAbility to assimilate information to garner support for resources, change, etc.\r\nUnderstanding of the key market drivers and dynamics of the US healthcare market.\r\nAdvocate/enforcer of our Corporate Compliance culture and policies.\r\nRole model for the 4-I Values (Integrity, Intensity, Innovation, and Involvement)', NULL, '5-6', '50000', 'Hindi', '2021-09-15 08:48:11', 0, ''),
(212, 'RFH00212', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'SELF', 'Usha Guru', '', 0, '123456', 'Strategy Analyst', 'WFH', NULL, 'HEPL', '5', '', 'Digital Marketing', '1', 'â¢ You must be an excel data story teller\r\nâ¢ you will be a key player in the success of our digital marketing efforts by defining the strategy for our marketing campaigns, analysing the results, and relaying results, successes/failures/surprises, and ultimately, the ROI to leadership. You will use data-analytics to define KPIs, and use a number of technologies/tools, to analyse campaigns and make recommendations to stakeholders.\r\nâ¢ The ideal candidate will possess skills and experience (at least 2 to 3 years) in defining various types of marketing campaigns, have some knowledge of SEO, and expertise in using programs like Google Analytics, Google AdWords, Google Tag Manager, email marketing tools etc.\r\nâ¢ You will possess the communication skills to deliver technical information to non-technical audiences, and maintain key relationships with the leadership and key stakeholders.\r\nâ¢ You will also research digital marketing trends (PPC advertising, online marketing best practices, for example), and how they can relate to company goals.\r\nâ¢ You will be responsible for creating weekly and monthly digital marketing reports for clients.\r\nâ¢ You will need to be well versed with statistics and terms involved in the day to day business and use it while discussing with stakeholders\r\nâ¢ You will be expected to constantly be on the lookout for ways to enhance value for your respective stakeholders/clients\r\nâ¢ The decisions you make impact your work and may impact the work of others\r\nâ¢ You will be an individual contributor as a part of a team, with a focused scope of work.', 'Any degree', 'have some knowledge of SEO, and expertise in using programs like Google Analytics, Google AdWords, Google Tag Manager, email marketing tools etc.\r\nData analytics, Communication, statistics knowledge, decision making skills', 'Data analytics, Communication, \r\nstatistics knowledge, decision making skills', '7-8', '66000', 'RFH Team, position created manually to assign for recruiters. \r\nCTC range up to 8lacs.', '2021-09-16 05:36:15', 0, ''),
(213, 'RFH00213', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'SELF', 'Usha Guru', '', 0, '123456', 'Strategy Manager', 'WFH', NULL, 'HEPL', '5', '', 'Digital Marketing', '1', 'â¢ Creating Digital Strategy pitch for the new clients \r\nâ¢ Updating the Digital strategy for existing clients month on month basis as per competitive environment, market trends, brandâs objectives.\r\nâ¢ Strategic skills: strong critical thinker, ability to architect solutions, and clearly communicate strategic ideas in a clear, simple manner\r\nâ¢ Experience leading and facilitating working sessions with both teams and leaders\r\nâ¢ Experience formulation of Digital strategy for Clients\r\nâ¢ Experience designing, developing and implementing marketing and digital processes and ways of working that bring agility to teams, \r\nâ¢ profound knowledge of market trends, digital transformations, competitive benchmarking. \r\nâ¢ Strong understanding of specific industry, client or technology and function as expert to advise senior leadership', 'MBA in Marketing with Digital Marketing certification', 'Basic Qualifications:\r\nâ¢ 7+ yearsâ experience client facing in a strategy consulting firm, digital innovation agency or high growth technology firm.\r\nâ¢ 5+ years of experience in thought leadership for multi-channel approaches and design areas including physical and connected.\r\nâ¢ 3+ yearsâ experience in growth strategy focused on one or more of the following areas: market penetration, market and product expansion, or diversity strategy.\r\nâ¢ 3+ yearsâ experience leading multiple cross-discipline teams.\r\nâ¢ MBA in Marketing with Digital Marketing certification from premier institutions.\r\n\r\nâ¢ Strategic skills: strong critical thinker, ability to architect solutions, and clearly communicate strategic ideas in a clear, simple manner', NULL, '7-8', '66K', 'RFH Team, position created manually to assign for recruiters. \r\nCTC range up to 8lacs.', '2021-09-16 05:53:19', 0, ''),
(214, 'RFH00214', 'Activity Outsourcing to HEPL', 'Kajal Sharma', '9035155500', 'kajalsharma@hemas.in', 'SELF', 'Usha Guru', '', 0, '123456', 'Creative Coordinator', 'WFH', NULL, 'HEPL', '5', '', 'Digital Marketing', '1', 'The creative coordinator must be from TN who can speak in Tamil to explain the requirement to designers.\r\n\r\nJob Role:-\r\n\r\nâ¢ Communication of daily reports and maintaining established feed of information to and from our clients.\r\nâ¢ Scheduling the meeting with the potential clients, participating in the corporate marketing programs and maintaining the necessary records.\r\nâ¢ Coordination between clients and the internal team.\r\nâ¢ Generation and Maintaining MIS.\r\nâ¢ Problem solving approach with effective communication and coordination\r\nâ¢ Coordinating on day to day basis with Marketing Team.\r\nâ¢ Managing Social Media activities & Content Writing smoothly\r\nâ¢ Coordination with Design team on day to day basis.\r\nâ¢ Ensuring the creatives are produced on time with high quality \r\nâ¢ Ensuring spellchecks and grammatical errors are excluded at design level before sharing with clients\r\nâ¢ Taking client approval and uploading creatives in respective brand folders for social media team to access.\r\nâ¢  Works with clients and internal teams to foster innovative solutions.\r\nâ¢ Directly interact with clients either internal or external while maintaining a positive attitude', 'UG/PG in Marketing', 'Requirement:\r\n1.Self- motivation and accountability for every aspect of project management to exceed\r\n2.Excellent communication skills, both written and oral\r\n3.Strong attention to detail\r\n4.Positive attitude focusing on team work.\r\n5.Must have excellent customer relations skills.\r\n6.Strong ability to organize and work on multiple tasks simultaneously\r\n7.Strong problem solving skills and detail oriented', 'The creative coordinator must be from TN who can speak in Tamil to explain the requirement to designers.', '7-8', '66000', 'RFH Team, position created manually to assign for recruiters. \r\nCTC range up to 8lacs.', '2021-09-16 06:00:40', 0, ''),
