(236, 'RFH00235', 'Activity Outsourcing to HEPL', 'Roopsundar Reddy K', '8884997977', 'roopsundar@hemas.in', 'SELF', 'Usha Guru', '', 0, '123456', 'FINANCE ANALYST', 'Work from Site', NULL, 'HEPL', '5', '', 'Finance', '1', 'â¢ 4-6 years of prior experience in a finance or analytical role, preferably 1-2 years in FMCG\r\nâ¢ Hands-on experience in executing analysis, Competitive study, gathering data from different sources, \r\nâ¢  Has a track record of discovering insights from massive data\r\nâ¢ Experience with business intelligence and visualization tools \r\nâ¢ Demonstrated ability to work independently in a fast-pace environment and manage multiple competing priorities\r\nâ¢ Ability to experiment with alternate analytical techniques to analyze the data and present\r\nâ¢ Gather data from various sources and ability to analyze reports & derive insights from data\r\nâ¢ Collecting and analyzing data for potential business expansion\r\nâ¢ Leading projects and coordinating with other teams to produce better business outcomes', 'â¢ Bachelor\'s/Masterâs in Business, Finance, or related Quantitative fields', 'The candidate must be excellent in number crunching & understand business problems & faciliate proof thru data\r\nâ¢ Strong modeling and Excel skills\r\nâ¢ Strong Analytics and presentation skills \r\nâ¢ Advanced knowledge of Excel (Power Pivots, Power Query, VBA) and PowerPoint\r\nâ¢ Exceptional analytical and critical thinking skills; highly detail oriented\r\nâ¢ Strong data collection, collation and cleansing skills using tools \r\nâ¢ Excellent communication skills â being able to communicate effectively', 'need a solid finance analyst  who can crunch numbers, give insights, who can read competition financial statements, come up with insights, provide comparative analytics for CKPL & respective group companies\r\n\r\nThe candidate must be excellent in number crunching & understand business problems & faciliate proof thru data', '4-5', '70-80K',