nistration', 'Good written and verbal skills as content development will be a part of the job', '4-5', '27000', 'Able to join us quickly', '2021-09-22 07:08:46', 0, ''),
(238, 'RFH00238', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Swathi', 'Karunakaran', 'Screenshot_(31).png', 0, NULL, 'Officer - Inside Sales', 'Work from Site', 'Chennai', 'CIPL', '5', 'Redbelly', 'Inside Sales', '1', 'Maintaining long-lasting relationships with existing customers through exceptional after-sales service.\r\nActively sourcing new sales opportunities through cold-calling and emailing.\r\nDeveloping in-depth knowledge of product features and benefits.\r\nUtilizing virtual meetings to build relationships with new customers.\r\nProcessing customers\' purchase orders and liaising with the logistics department to ensure the timely delivery of ordered products.\r\nAdvising customers on suitable product selection based on their needs and specifications.\r\nCreating a sales pipeline to accurately reflect the relative placement of sales prospects in the purchasing process.\r\nFollowing up on sales inquiries that are made by potential customers through website chats, emails, and inbound calls.\r\nSetting up face-to-face meetings between potential customers and Outside Sales Representatives.', 'Any Degree', 'Qualification Graduation or diploma.\r\nMust and should know Hindi, anyone south language with English,\r\nWilling to work from office Chennai location \r\nPrevious experience in an outbound call center or a related sales position is preferred.\r\nProficiency in Microsoft Office, Excel, and CRM software.\r\nExcellent communication skills, both verbal and written.\r\nGood organizational skills and the ability to multitask.\r\nExcellent phone and cold calling skills.\r\nExceptional customer service skills.\r\nStrong listening and sales skills.\r\nAbility to achieve targets.\r\n**Preferred for Females**', NULL, '1-2', '18', 'Female Candidate / Hindi & English Must', '2021-09-22 08:56:52', 0, ''),
(239, 'RFH00239', 'Manpower Outsourcing to HEPL', 'Arun Christy', '8668145790', 'arunchristy@cavininternational.com', 'Swathi', 'Karunakaran', 'Screenshot_(31)1.png', 0, NULL, 'CRM Associate', 'Work from Site', 'Chennai', 'CIPL', '5', 'Redbelly', 'CRM', '1', 'Planning and delivering CRM strategies across the organization with a view to retaining existing customers, increasing brand loyalty, and expanding the company brand.\r\nDeciding on a final CRM structure and architecture that will work seamlessly across the business and capture crucial information along the sales funnel.\r\nMaking sure the customer database is correctly segmented for targeted marketing activities.\r\nCollaborating with other departments ensures the CRM strategy works well for every aspect of the business.\r\nDevelopment of testing strategies to guarantee the most efficient approach for the organization and its customers.\r\nComing up with creative ideas, preparing proposals, overseeing the production process & execution, and reporting the results to the relevant people.\r\nCreating emails and other content as part of a wider marketing campaign.\r\nAnswering customer queries and dealing with complaints.', 'Any Degree', 'Must and should know Hindi, anyone south language with English,\r\nWilling to work from office Chennai location \r\nPrevious experience in an outbound call center or a related sales position is preferred.\r\nProficiency in Microsoft Office, Excel, and CRM software.\r\nExcellent communication skills, both verbal and written.\r\nGood organizational skills and the ability to multitask.\r\nExcellent phone and cold calling skills.\r\nExceptional customer service skills.\r\nStrong listening and sales skills.\r\nAbility to achieve targets.\r\n**Preferred for Females**', NULL, '1-2', '15', 'Female candidate preferred / Hindi & English Must', '2021-09-22 09:05:18', 0, ''),
