(319, 'RFH00319', 'Manpower Outsourcing to HEPL', 'RFH Team', '9841510715', 'pvenkatesh@cavinkare.com', 'Area Sales Manager', 'Usha Guru', '', 0, NULL, 'Business Development Officer (BDO)', 'Work from Site', 'Silchar-1, Visakhapatnam -1, Chennai-1, Vijayawada-1, Ludhiana-1', 'CKPL', '5', 'Raaga', 'Sales & Distribution', '5', 'ï To achieve the primary and secondary targets every JC in the assigned territory\r\nï Directly responsible to deliver sales growth as per the organizationâs objectives\r\nï Explain prospective clients about the advantages of the products and services offered and follow up with them in order to close the business deals\r\nï Respond to the client queries regarding the products in a timely fashion\r\nï Develop strong customer relationships in order to generate high volume of prospective clients\r\nï To maintain healthy relationships with super stockiest and sub stockiest and motivate them to increase sales\r\nï To ensure availability, visibility and stock against competition in all the salon outlets in the assigned territory\r\nï To ensure distribution and productivity objective are met in the respective areas\r\nï To ensure 100% market coverage in the assigned territory\r\nï To ensure all the territory salons are trained in complete range of Raaga products\r\nï To ensure execution of planned promotions in the outlets\r\nï To ensure proper utilization of POP materials in the assigned territory in order to create visibility for the brand\r\nï To increase the number of Perfect salons in the assigned territory\r\nï To adhere to permanent journey plan, coverage plan, beat plan and daily route coverage plan\r\nï To work effectively with the technical team and ensure demoâs are conducted as per plan', 'Any Degree', 'Functional Competencies\r\n\r\nï Process Knowledge â Thorough understanding of Sales processes, replenishment process and related MIS / analysis\r\nï Distribution expansion - Enhance coverage in a defined budget. Ensure there is complete coverage in the assigned territory\r\nï Product Knowledge - Basic understanding of categories and products vis-Ã -vis the competition\r\nï Market Knowledge - Understanding of the geography and relationship with dealers\r\nï Trade relations - Relations with the retailers and leverage the sales', 'Looking candidates from professional care background.\r\n\r\nï Interpersonal relationship - Amiable & builds rapport, approachable & friendly, listens attentively\r\nï Relationship Management - Cooperative in dealing with people, mild-mannered, dependable and deliberate\r\nï Driving for Results - Responsible for execution, accurate & precise in delivery, disciplined\r\nï Process adherence - Compliant to systems, Methodical & logical, perfectionist, careful & steady, persistent in following SOPs).', '4-5', '46000', 'RFH Team, position created manually to assign for recruiters. \r\nLooking candidates from professional care background.\r\nCTC: 5,60,000 per annum\r\nCV share To: pvenkatesh@cavinkare.com, recruit1@cavinkare.com\r\nCc: karthikdavid@hemas.in, karthigaj@cavinkare.com', '2021-12-10 03:57:21', 0, ''),
(320, 'RFH00320', 'Manpower Outsourcing to HEPL', 'RFH Team', '9841510715', 'pvenkatesh@cavinkare.com', 'CKPL HM', 'Usha Guru', '', 0, NULL, 'Performance Marketing', 'WFH', NULL, 'CKPL', '4', 'Raaga', 'Marketing', '1', 'Job description\r\nManage the day-to-day search marketing activities across multiple search engines including researching, growing and optimizing keyword portfolios and bid management strategies and refining campaigns through ad copy tests, landing pages, negative keywords, etc.\r\nDrive revenue, achieve targeted ROI and maintain positive KPI trends; Determine monthly, quarterly and annual revenue forecasts and budgets.\r\nTrack and evaluate KPIs of all marketing channels (email, SEM, SEO, display, retargeting, shopping engines, affiliates, referring partners, social, etc.) and determine necessary adjustments to optimize overall marketing effectiveness in line with budgeted marketing spend.\r\nWork with affiliate networks to recruit new affiliates and negotiate commissions, build relationships and increase engagement with existing affiliates, ensuring the correct and timely delivery of campaign materials.   \r\nPlan email-marketing calendar and executions in close cooperation with Brand Marketing. Manage the execution of these campaigns. Measure results and ROI of these campaigns. Build an email-target database and define opportunities to grow the size of the database.  \r\nWork with the Brand Marketing team to create aligned consumer communications across all channels (onsite, social, mobile, stores) and to ensure both strong commercial and consistent brand messages.   \r\nWork with the Site Merchandising team on an annual site and campaign calendars, detailing the timelines of seasonal promotions, along with other campaigns  \r\nSite optimization: Define opportunities on site (structure) and content to drive Search Engine Optimization  \r\nDeliver clear, concise and reliable reporting on all activities to key stakeholders\r\n\r\n\r\nResponsibilities:  \r\n \r\n1) Manage New product / focus product off-take drive in market \r\n                  Target of Salon per sq ft visibility and shelf space visibility in the Salons of the product and the brand\r\n \r\n2) Designing regional GTM as per market trends and product / category availability \r\n                  Identify competition & market trending\r\n                  Product selling story for salons\r\n \r\n3) Align and ensure execution of BTL / On ground activities which lead to brand visibility\r\n                  Ensuring salon loyalty & salon engagement activities \r\n       \r\n4) Ensure marketing element visibility/ In-salon product & brand visibility as per the brand guidelines and as per corporate norms\r\n                 Visibility of the brand to be driven as per the Brand guidelines ( ensuring that brand guidelines are not being tampered or mis-sold in market)           \r\n \r\n5) Execution of consumer promotion & product campaigns in the market along with regional stakeholders ( ASM / BDO) and corporate team\r\n                 Support Brand managers with Localized inputs and brand communication stories as well as Salon testimonials\r\n                 Example : In-salon video shoot with Key accounts and co-branding activities with KOLs (like Lakhme)\r\n \r\n6) Ensure vendor alignment employed for all market working where-in brand guidelines comes into effect', 'masterâs degree in marketing or a related field', 'E-Commerce performance marketing, Budget management, PL management, A+ content, Listing on ecom platform, Consumer Promos/discounts, Return on Ads Spends,Cost To Sales.', NULL, '4-5', '125000', 'RFH Team,position created manually to assgin for recruiters. \r\nCTC-15,00,000 per annum\r\n\r\nCV share To: pvenkatesh@cavinkare.com, recruit1@cavinkare.com\r\nCc: karthikdavid@hemas.in, karthigaj@cavinkare.com', '2021-12-10 04:06:06', 0, ''),
