ibilities:  \r\n \r\n1) Manage New product / focus product off-take drive in market \r\n                  Target of Salon per sq ft visibility and shelf space visibility in the Salons of the product and the brand\r\n \r\n2) Designing regional GTM as per market trends and product / category availability \r\n                  Identify competition & market trending\r\n                  Product selling story for salons\r\n \r\n3) Align and ensure execution of BTL / On ground activities which lead to brand visibility\r\n                  Ensuring salon loyalty & salon engagement activities \r\n       \r\n4) Ensure marketing element visibility/ In-salon product & brand visibility as per the brand guidelines and as per corporate norms\r\n                 Visibility of the brand to be driven as per the Brand guidelines ( ensuring that brand guidelines are not being tampered or mis-sold in market)           \r\n \r\n5) Execution of consumer promotion & product campaigns in the market along with regional stakeholders ( ASM / BDO) and corporate team\r\n                 Support Brand managers with Localized inputs and brand communication stories as well as Salon testimonials\r\n                 Example : In-salon video shoot with Key accounts and co-branding activities with KOLs (like Lakhme)\r\n \r\n6) Ensure vendor alignment employed for all market working where-in brand guidelines comes into effect', 'masterâs degree in marketing or a related field', 'E-Commerce performance marketing, Budget management, PL management, A+ content, Listing on ecom platform, Consumer Promos/discounts, Return on Ads Spends,Cost To Sales.', NULL, '4-5', '175000', 'RFH Team,position created manually to assgin for recruiters. \r\nCTC-21,00,000 per annum\r\n\r\nCV share To: pvenkatesh@cavinkare.com, recruit1@cavinkare.com\r\nCc: karthikdavid@hemas.in, karthigaj@cavinkare.com', '2021-12-10 04:10:05', 0, ''),
(322, 'RFH00322', 'Manpower Outsourcing to HEPL', 'RFH Team', '9841510715', 'pvenkatesh@cavinkare.com', 'CKPL HM', 'Usha Guru', '', 0, NULL, 'Social Media Manager', 'Work from Site', NULL, 'CKPL', '4', 'Raaga', 'Social Media Manager', '1', 'â¢ Design and implement social media strategy to align with business goals\r\nâ¢ Perform research on current benchmark trends and audience preferences\r\nâ¢ Competitor benchmarking (using tools like unmetric, social bakers etc)\r\nâ¢ Collaborate with other teams, like marketing, sales and customer service to ensure brand consistency\r\nâ¢ Set specific objectives and report on ROI\r\nâ¢ Generate, edit, publish and share engaging content daily (e.g. original text, photos, videos and news)\r\nâ¢ Create campaign briefs and content briefs for agency\r\nâ¢ Oversee & create social media content (copywriting, design)\r\nâ¢ Monitor SEO and web traffic metrics (using tools like Google Analytics, Similar Web, Semrush, Moz etc.)\r\nâ¢ Create post boost plans with targeting options and placements\r\nâ¢ Monitor brand sentiment among customers (using tools like Meltwater, Sprinklr, OneDirect)\r\nâ¢ Suggest and implement new features to develop brand awareness, like promotions and competitions\r\nâ¢ Stay up-to-date with current technologies and trends in social media, design tools and applications\r\nâ¢ Create & manage dedicated online community\r\nâ¢ Define the Influencer ecosystem internally and externally at the PAN India level\r\nâ¢ Implement standards for Influencer activity, as per the brand brief and marketing objective\r\nâ¢ Design end-to-end full-scale influencer campaigns that support marketing initiatives, and brand objectives\r\nâ¢ Lead the influencer campaign, collaboration plan and performance metrics\r\nâ¢ Initiate, collaborate & groom the influencer community including reaching out to new influencers, activating existing influencers, and build and maintain a strong relationship\r\nâ¢ Day to day account management, including the review of influencer trackers, reports, recaps, maintaining database invoices, budget management, etc\r\nâ¢ Research, locate, and engage potential influencers across all channels to build a pipeline of talent\r\nâ¢ Coordination with internal teams as per the campaign requirements', 'â¢masterâs degree in marketing or a related field', 'â¢ Social media skills\r\nâ¢ Creating and maintaining client relationships\r\nâ¢ Managing Processes\r\nâ¢ Self-motivated yet customer-focused\r\nâ¢ Proficient in marketing research and statistical analysis \r\nâ¢ Proven working experience (4-6 years) in digital marketing, particularly within FMCG/CD industry', 'â¢ Proven working experience (4-6 years) in digital marketing, particularly within FMCG/CD industry\r\nCTC- 15,00,000 per annum.\r\nlook for profiles with extensive influencer marketing experience & preferrable from D2C personal care comanies like Wow, Mamaearth, Plum, Moms company, Love beauty planet etc.', '4-5', '125000', 'RFH Team,position created manually to assign for recruiters. \r\nCTC- 15,00,000 per annum.\r\n\r\nCV share To: pvenkatesh@cavinkare.com, recruit1@cavinkare.com\r\nCc: karthikdavid@hemas.in, karthigaj@cavinkare.com', '2021-12-10 04:16:27', 0, ''),
(323, 'RFH00323', 'Manpower Outsourcing to HEPL', 'RFH Team', '9841510715', 'pvenkatesh@cavinkare.com', 'CKPL HM', 'Usha Guru', '', 0, NULL, 'Assistant Manager - Trade Marketing', 'Work from Site', NULL, 'CKPL', '4', 'Personal Care', 'Trade Marketing', '1', 'ï§ Achievement of volume/value targets by JC/QTR/year for total region with direct responsibility of all channels.\r\nï§ Distribution and display leadership independent to ZSM/ASM\r\nï§ Contribute in creating the correct RTM model; determine town and outlet penetration suitable for current and future business growth in the country.\r\nï§ Drive new outlet additions at the zone especially in Non South and ensure they sustain so that revenue increase happens over a period of 2-3 quarters.\r\nï§ Develop and execute Trade Marketing initiatives in coordination with the Central Trade marketing team.\r\nï§ Execute display and merchandising guidelines in EVERY channel; develop display aids, and local vendors in region.\r\nï§ Execute display and merchandising guidelines in MTinGT outlets and ensure the right outlets are focused for generating incremental revenues from higher SKUâs and specific focus brands.\r\nï§ Manage the NPD from launch till first 6 months and ensure the right value and outlets are focused. Ensure NPD drives value and distribution growth in the right channels and hence contribute to overall revenue growth for distributors.\r\nï§ Manage TP & TPR budgets at region.   \r\nï§ Pilot test key in-market initiatives, analyze results and make recommendations.\r\nï§ Regional custodian of Loyalty program in the retail/ wholesale channel and keep complete track of outlet wise business trends. Contribute continuous need based refinement of Loyalty program in coordination with ZSMand Central Trade marketing team for the zone.\r\nï§ Drive the different loyalty programs designed for Rural, Wholesale, Salesman and Own your business. This will be the biggest differentiator for zonal business growth.\r\nï§ Own the Van / Hawker/Fleet business at the zones and drive differential growth through outlet addition and hence revenue growth.\r\nï§ Secure key sales information from field sales and present business analytics and findings through planned reviews on monthly basis.\r\nï§ Analyze data to gauge effectiveness of key activities and promos through a pre-agreed control panel and use the analysis to fine tune future activities\r\nï§ Evaluate the productivity of the field force. \r\nï§ Assist wholesalers, retailers, or distributors with their marketing strategy, including message development, marketing materials, and brandawareness. Market products to wholesalers and retailers. Develop strategies to generate interest in these products, creating demand for the products at wholesalers and retail organizations \r\nï§ Should be able to focus on developing and overseeing all aspects of organization\'s marketing activities. General job responsibilities may involve representing theorganization at relevant industry tradeshows, designing unique plans for individual products, and overseeing and analyzing new product launches. Trade marketing managers should advise on appropriate promotional procedures established from customer data analysis and current trends. Trade marketing managers may also advise retail store locations on methods for in-store solutions and consistently monitor if these methods are effective.\r\nï§ Require travel at least 3-4 days a week.', 'Any degree', 'JD', NULL, '4-5', '100000', 'RFH Team, position created manually to assign for recruiters.\r\nCTC- 12,00,000per annum.\r\n\r\nCV share To: pvenkatesh@cavinkare.com, recruit1@cavinkare.com\r\nCc: karthikdavid@hemas.in, karthigaj@cavinkare.com\r\n\r\nCV share To: pvenkatesh@cavinkare.com, recruit1@cavinkare.com\r\nCc: karthikdavid@hemas.in, karthigaj@cavinkare.com', '2021-12-10 04:22:02', 0, ''),
