(344, 'RFH00344', 'Manpower Outsourcing to HEPL', 'Arun Christy', '9677139892', 'arunchristy@cavininternational.com', 'Naveen', 'Karunakaran', 'Screenshot_(68).png', 0, '', 'Research Associate', 'Work from Site', 'Chennai, OMR', 'CIPL', '5', 'Redbelly', 'Molecular ', '1', 'Collects, prepares, analyzes, dissects, and evaluates samples. \r\nKnowledge in PCR and Optimisation. \r\nOperates laboratory equipment; contributes to laboratory maintenance. \r\nPerforms a variety of assays, tests, and studies of a routine nature. \r\nPerforms calculations to complete research test results; collates data; performs statistical analysis of lab results and maintain notes and log or computer database; performs basic procedures for computer-assisted data analysis. \r\nPrepares stock chemical solutions. ', 'B.Tech - Bio Technology', 'Team work and communicationÂ skills. \r\nAn investigative mind. \r\nAttention to detail. \r\nKnowledge in PCR Technic & Optimization \r\nProblem Solving / Critical Thinking / Logical Reasoning ', '', 'less than 1', '15000', 'Male - Fresher', '2022-01-03 11:10:04', 0, ''),
(346, 'RFH00345', 'Activity Outsourcing to HEPL', 'Prijith R', '8921058940', 'prijith.r@hemas.in', 'Ashna Sujith', 'Pradeesh', '', 0, '1234', 'Telecaller', 'WFH', 'TN', 'HEPL', '5', '', 'Operations', '4', 'Order Taking\r\nTelecalling/Telesales', 'Degree/Diploma', 'Exposure in Telecom/Credit card sales\r\nConvincing + Sales skills\r\nTelesales experience is must', NULL, '1-2', '13000', NULL, '2022-01-03 11:20:04', 0, ''),
(347, 'RFH00347', 'Manpower Outsourcing to HEPL', 'Arun Christy', '9677139892', 'arunchristy@cavininternational.com', 'Tamilini', 'Karunakaran', 'Screenshot_(69).png', 0, '', 'Junior Scientist ', 'Work from Site', 'Cuddalore & Initial training in Chennai', 'CIPL', '5', 'Corporate', 'New Product Development - Pet Animals', '2', 'Prepare the formulation and feed in alignment with Nutritionist\r\nPlan the experiments in order to reduce the error in execution\r\nUnderstand the experiment methodology and bring in creative ideas through continue update on the field.\r\nMonitor the process and record the data on daily basis. \r\nFlawless execution of the experiments and disseminating results by presentation at meetings.\r\nProcure and purchase raw materials needed for animal feed\r\nInterpret the results and provide summary and conclusion in alignment with Nutritionist\r\n', 'M.Tech Food Technology / Food Processing', 'Food Technology\r\nReading Ability \r\nExcell Knowledge', '', 'less than 1', '25000', 'Place of work will be in Cuddalore & Initial training will be given in Chennai', '2022-01-04 06:47:14', 0, ''),
(348, 'RFH00348', 'Manpower Outsourcing to HEPL', 'Usha Guru', '9940026666', 'ushaguru@cavinkare.com', 'Self', 'Usha Guru', 'RFHAH3521646636501.jpg', 1, NULL, 'Front office Associate', 'Work from Site', 'Onsite-Ekkaduthangal', 'CKPL', '5', 'Personal Care', 'Front office Associate', '1', 'looking for a smart Front office Associate for our very prestigious site - Chennai R&D cum Registered office\r\n\r\nA smart fresher, who is quick to learn & adapt.', 'Any Degree', 'A smart fresher, who is quick to learn & adapt.', NULL, 'less than 1', '15000', 'RFH Team, position created manually to assign for recruiters. CTC check with team.\r\n\r\nUmashankar will do the final round after HR screening.\r\n\r\nCVs share To; ushaguru@cavinkare.com\r\n                      Cc: umashankar.s@CavinKare.com', '2022-01-04 08:06:46', 0, ''),
(349, 'RFH00349', 'Manpower Outsourcing to HEPL', 'Usha Guru', '9940026666', 'ushaguru@cavinkare.com', 'Marshel', 'Usha Guru', 'RFHAH3521646638262.jpg', 1, '123456', 'Virtual Auditor', 'Work from Site', 'Cuddalore', 'CIPL', '5', 'Projects (CIPL)', 'Virtual Audit', '1', 'Work timing-10 a.m to 7 p.m\r\nReview all our Civil projects basis the milestone of the project on a daily basis\r\nTrack all milestones / update respective stakeholders of any delays\r\n\r\nFemale candidate, B.E Civil Engineering background with 2 or 3 years experience \r\nMature woman candidate who had a career break - 2nd innings is very welcome', 'B.E Civil Engineering background', 'Female candidate, B.E Civil Engineering background with 2 or 3 years experience \r\nGood communication, Leadership skills, Dont give up attitude, eye for detail, smart & quick thinking is required', 'immediate joiners preferred.', '2-3', '20000', 'immediate joiners preferred.\r\nMature woman candidate who had a career break - 2nd innings is very welcome\r\nPosition Reports to Marshel.\r\n\r\nRFH Team, position created manually to assign for recruiters. \r\nCVs share To:  marshel@cavinkare.com, pradeeshn@cavinkare.com\r\nCc; karthikdavid@hemas.in,  ushaguru@cavinkare.com', '2022-01-06 11:14:21', 0, ''),
